import React from 'react';

const Skills = () => {
    return (  
        <div className="section">
            <div className="container">
                <h2 className="skils-title">Skills</h2>
                <p className="skills-subtitle">My Personal skills</p>
            </div>
        </div>
    );
}

export default Skills;
